import React, { Component } from "react";
import { jQuery as $ } from "jquery";
import "popper.js";
import "bootstrap/dist/js/bootstrap";
import "bootstrap/dist/css/bootstrap.css";

class Species extends Component {
    render() {
        return (
            <div className="container" style={{ height: "90.75%" }}>
                <div className="row h-100">
                    <div className="col-4 h-100">
                        <div id="common-name" style={{ height: "20%" }}>
                            abc
                        </div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #000000" }}
                        />
                        <div id="description" style={{ height: "20%" }}>
                            abc
                        </div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #000000" }}
                        />
                        <div id="" style={{ height: "20%" }}>
                            abc
                        </div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #000000" }}
                        />
                        <div id="food" style={{ height: "20%" }}>
                            abc
                        </div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #000000" }}
                        />
                        <div id="habitat" style={{ height: "20%" }}>
                            abc
                        </div>
                    </div>
                    <div className="col-8" style={{ height: "100%" }}>
                        abc
                    </div>
                </div>
            </div>
        );
    }
}

export default Species;
